import { LOGIN_FAIL, LOGIN_REQUEST, LOGIN_SUCCESS } from "../Constants"

export const registerReducer = (state = {}, action) => {
    switch (action.type) {
        case LOGIN_REQUEST:
            return {
                loading: true,
            }
        case LOGIN_SUCCESS:
            return {
                loading: false,
                emailNotExist: action.payload
            }
        case LOGIN_FAIL:
            return {
                loading: false,
            }
        default:
            return state;
    }
}
